// src/pages/ChildrenMinistry.js
import React from 'react';

const ChildrenMinistry = () => {
  return (
    <div>
      <h1>Children Ministry</h1>
      <p>Welcome to the Children Ministry page.</p>
      <p>Focuses on evangelizing, teaching, and discipling children to live victorious Christian lives.</p>
    </div>
  );
};

export default ChildrenMinistry;
